import React from 'react'
import BudgetItem from './BudgetItem'

const BudgetList = ({expenses}) => {
    return (
        <React.Fragment>
            <ul className="list">
                {
                    expenses.map((expense) => (
                        <li>
                            <BudgetItem key={expense.id} expense={expense} />
                        </li>
                    ))
                }
            </ul>
            {expenses.length > 0 &&
                <button className="btn">
                 clear expenses 
               </button>
            }
       </React.Fragment>
    )
}
export default BudgetList
